import React, { Component } from 'react'
import EmployeeService from '../services/EmployeeService'

class ListEmployeeComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
                employees: []
        }
        this.addEmployee = this.addEmployee.bind(this);
        this.editEmployee = this.editEmployee.bind(this);
        this.deleteEmployee = this.deleteEmployee.bind(this);
    }

    deleteEmployee(id){
        EmployeeService.deleteEmployee(id).then( res => {
            this.setState({employees: this.state.employees.filter(employee => employee.id !== id)});
        });
    }
    viewEmployee(id){
        this.props.history.push(`/view-employee/${id}`);
    }
    editEmployee(id){
        this.props.history.push(`/add-employee/${id}`);
    }

    componentDidMount(){

        EmployeeService.getEmployees().then(
            (res) => {
            this.setState({ employees: res.data});
        }
        ).catch((err: any) => {
            var returnJson = [{"id":1,"firstName":"Siva","lastName":"Kumar","emailId":"WorkShiva1@gmail.com"},{"id":2,"firstName":"Siva","lastName":"Krish","emailId":"WorkShiva2@gmail.com"},{"id":3,"firstName":"Krishna","lastName":"Kumar","emailId":"Krish1@gmail.com"},{"id":4,"firstName":"Krishna","lastName":"Shiva","emailId":"Krish2@gmail.com"}];
            console.log('What happened? ' + err.res.data);
            this.setState({ employees: returnJson});
        }
        );
    }

    addEmployee(){
        this.props.history.push('/add-employee/_add');
    }

    render() {
        return (
            <div>
                 <h2 className="text-center">Employees List</h2>
                 <div className = "row">
                    <button className="btn btn-primary" onClick={this.addEmployee}> Add Employee</button>
                 </div>
                 <br></br>
                 <div className = "row">
                        <table className = "table table-striped table-bordered">

                            <thead>
                                <tr>
                                    <th> Employee First Name</th>
                                    <th> Employee Last Name</th>
                                    <th> Employee Email Id</th>
                                    <th> Actions</th>
                                </tr>
                            </thead>
                            <tbody>

                            </tbody>
                        </table>

                 </div>

            </div>
        )
    }
}

export default ListEmployeeComponent
